object RedisUtil extends Constants{
    var jedisPool: JedisPool = null

    def init() = {
        try {
            val config: GenericObjectPoolConfig = new GenericObjectPoolConfig
            config.setMaxTotal(MAX_ACTIVE)
            config.setMaxIdle(MAX_IDLE)
            config.setMaxWaitMillis(MAX_WAIT)
            config.setTestOnBorrow(TEST_ON_BORROW)

            if(null != password && password.length>3){
                jedisPool = new JedisPool(config, host, port, TIMEOUT, password, db, null)
            }else{
                jedisPool = new JedisPool(config, host, port, TIMEOUT)
            }

        } catch {
            case e: Exception => {e.printStackTrace()}
        }
    }

    def getResource(): Jedis ={
        var jedis: Jedis = null

        try{
            jedis = jedisPool.getResource
        }catch {
            case e: Exception => {
                init()
                jedis = jedisPool.getResource
            }
        }
        jedis
    }
