    /***Hash***/
    def putHash(key: String, k: String, v: String): Unit ={
        val jedis = getResource()
        val value = jedis.hset(key, k, v)
        jedis.close()
    }

    /***List操作***/
    def putList(key: String, value: String): Unit ={
        val jedis = getResource()
        jedis.rpush(key, value)

        jedis.close()
    }

    def getList(key: String) ={
    val jedis = getResource()
    val index = jedis.llen(key).toInt
    val listBuffer: ListBuffer[(Int, Long, String)] = new ListBuffer()
    for(i <- 0 until index){
    listBuffer.append((0, 0L, jedis.lpop(key))) // 这里是为了与从kafka中读取的数据格式保持一致
}
    jedis.close()

    listBuffer.toList
}

    /******set操作*****/
